import React from "react";

const ExpenseDate = (props) => {
  console.log("INI PROPS", props);
  const getMonths = props.dates.toLocaleString("en-US", { month: "long" });
  const getDates = props.dates.toLocaleString("en-US", { day: "2-digit" });
  const getYears = props.getFullYear()
  return (
    <div>
      <div>{getMonths}</div>
      <div>{getDates}</div>
      <div>{getYears}</div>
    </div>
  );
};

export default ExpenseDate;
